      SELECT DISTINCT + 68 + - cor1.col2 AS col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5417.out
    data: |
      30
      41
      42
